import React from 'react';

import './App.css';
import Page from './Page.js'
import Home from './Home.js'
import Sidebar from './Sidebar.js'
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useParams
} from "react-router-dom";

function App() {
  return (

    <div className="App">
      <Home/>
      <Switch>
          <Route path="/:id" children={<Page/>} />
      </Switch>
    </div>
  );
}

export default App;
